import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  return (
    <div className="App container-fluid">
      <Row>
        <Col className="bg-secondary p-5 text-light" md={5}>
          <h1 className="font-weight-bold">Chazzy</h1>
        </Col>
        <Col className="bg-light p-5 heightFull align-items-center" md={7}>
          <h4>Chazzy</h4>
        </Col>
      </Row>
    </div>
  );
}

export default App;
